style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("dailypaul.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, footer, div, span, label

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

form, textarea, pre

{
background: #333333 !important;
}

}
